import Timer from "./timer";
import React from "react";
import { useNavigate } from "react-router-dom";

const buttonNames = [
    'Seizure',
    'Heart Attack',
    'Stroke',
    'Choke',
    'Diabetes',
    'Blood',
    'Asthma',
    'Broken Bones',
];

const buttonImages = [
    'https://example.com/seizure-image.jpg', // Replace with a valid image URL
    'https://example.com/heart-attack-image.jpg',
    'https://example.com/stroke-image.jpg',
    'https://example.com/choke-image.jpg',
    'https://example.com/diabetes-image.jpg',
    'https://example.com/blood-image.jpg',
    'https://example.com/asthma-image.jpg',
    'https://example.com/broken-bones-image.jpg',
];

export function ButtonContainer() {
    const navigation = useNavigate();
    const buttons = buttonNames.map((name, index) => (
        <button
            key={index}
            className="button"
            style={{ backgroundImage: `url(${buttonImages[index]})` }}
            onClick={() => navigation('/' + name.toLowerCase().replace(/\s+/g, '-'))}
        >
            {name}
        </button>
    ));

    return (
        <div className="button-container">
            {buttons}
            <div className="emergency-container">
                <button className="emergency-button">Et </button>
            </div>
            <Timer />
        </div>
    );
}

export default ButtonContainer;
